import logo from './logo.svg';
import './App.css';
import Header from './Header.js';
import Map from'./Map.js';
import Vehicles from'./Vehicles.js';


function App() {
    <Router>
        <Routes>
            <Route exact path="/" element={<Home />} />
            <Route path="/map" element={<div id="body"><Header /><Map /></div>} />
        </Routes>
    </Router>
  return (
    <div id="body">
      <Header />
      <Map />
    </div>
  );
}

export default App;
